import React from 'react';

const nums = [1, 2, 3, 4, 5, 6, 7, 8, 9, "+", "-", "*", "=", "c", "/", "**"];


const Calculate = () => {


  return (
    <div className='calc'>
      {nums.map((num)=>{
      return( <div>{num}</div>)
      })}
    </div>


  )
}

export default Calculate;
